function msg(alertValue) {
alert(alertValue); 
}

function write(writeValue) {
document.write(writeValue); 
}
 
function multiply(int1, int2) {
var product = parseInt(int1 * int2);
msg(product);
}

function divide(divInt1, divInt2) {
var quotient = parseInt(divInt1/divInt2);
msg(quotient);
}

function add(addInt1, addInt2) {
var sum = parseInt(addInt1 + addInt2);
msg(sum);
}

function subtract(subInt1, subInt2) {
var difference = parseInt(subInt1 - subInt2);
msg(difference);
}

